    body {

      font-size: 2.2rem;
      margin-top: 5px;
      text-shadow: 0 0 8px rgba(0,170,255,0.7), 0 0 15px rgba(0,170,255,0.6);
    }
    .loading-text {
      font-size: 1.2rem;
      margin-top: 15px;
      color: #00aaff;
      font-weight: bold;
      animation: pulseText 1.5s infinite;
    }
    .loading-text i {
      margin-right: 8px;
    }
    @keyframes pulseText {
      0%, 100% { opacity: 1; }
      50% { opacity: 0.5; }

    .error-text {
      font-size: 1.2rem;
      margin-top: 15px;
      color: #ff4d4d;
      font-weight: bold;
    }
    .card {
      background: linear-gradient(145deg, #101b2d, #0d1423);
      border: none;
      border-radius: 20px;
      box-shadow: 0 10px 25px rgba(0,0,0,0.6);
      transition: transform 0.4s ease, box-shadow 0.4s ease;
      overflow: hidden;
      cursor: pointer;
    }
    .card:hover {
      transform: translateY(-10px) scale(1.02);
      box-shadow: 0 15px 35px rgba(0,0,0,0.8);
    }
    .card-img-container {
      position: relative;
      overflow: hidden;
      border-top-left-radius: 20px;
      border-top-right-radius: 20px;
    }
    .card-img-top {
      transition: transform 0.5s ease;
      width: 100%;
      display: block;
    }
    .card:hover .card-img-top {
      transform: scale(1.08);
    }
    .card-title {
      color: #fff !important;
      font-weight: bold;
      font-size: 1.2rem;
    }
    .horario {
      color: #fff !important;
      margin-top: 8px;
      font-size: 0.95rem;
    }
    /* ðŸ”¥ Badge status */
    .status-overlay {
      position: absolute;
      bottom: 10px;
      left: 10px;
      padding: 6px 14px;
      border-radius: 6px;
      font-size: 0.9rem;
      font-weight: bold;
      display: inline-flex;
      align-items: center;
      gap: 6px;
      text-transform: uppercase;
    }
    .status-live {
      background: #e50914;
      color: #fff;
    }
    .status-soon {
      background: #0B7AAD;
      color: #fff;
    }
